import React, {Component, Fragment} from 'react';

// JSX 需要一个最外层的标签包裹住
// 如果不想用标签包裹，可以使用占位符（Fragment）标签
class TodoList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            inputValue: '',
            list: []
        };
    }

    render() {
        return (
            <Fragment>
                <input type="text" value={this.state.inputValue}/>
                <button>
                    提交
                </button>
                <ul>
                    <li>学英语</li>
                    <li>考驾照</li>
                </ul>
            </Fragment>
        );
    }
}

export default TodoList;
